import React, { forwardRef } from 'react';

const FAQ = forwardRef(({ questions }, ref) => {
  return (
    <section ref={ref} className="faq-section">
      <h2>Frequently Asked Questions</h2>
      {questions.map((faq, index) => (
        <div key={index} className="faq-item">
          <h3>{faq.question}</h3>
          <p>{faq.answer}</p>
        </div>
      ))}
    </section>
  );
});

export default FAQ;
